ivec2 convert_position_i(vec2 p1, vec2 s1, vec2 s2, vec2 d2) {
    ivec2 index_partial = ivec2(p1) * ivec2(s1);
    ivec2 s2i = ivec2(s2);
    ivec2 d2i = ivec2(d2);

    ivec2 index;
    ivec2 p2i;

    index *= 0;
    p2i *= 0;

    ivec2 m;

            index += index_partial[0];
            m = index / s2i;
            p2i += m;
            index -= m*s2i;


