        int h2 = p_Y.y;
        int w2 = p_Y.z; 
        int c = p_Y.w;

        float v = -1e5;

        for (int kh = 0; kh < 3; kh++) {
            int h1 = h2 * SH - PH + kh;
            if (h1 < 0 || h1 >= H1) continue;

            for (int kw = 0; kw < 3; kw++) {
                int w1 = w2 * SW - PW + kw;
                if (w1 < 0 || w1 >= W1) continue;

                v = max(texture2D(X, convert_coord(vec4(n, h1, w1, c) + 0.5, s_X, s_x, d_x)).r, v);
            }
        }

        gl_FragColor = vec4(v, 0, 0, 0);
    }

