    p2i *= 0;

    ivec4 m;

            index += index_partial[0];
            m = index / s2i;
            p2i += m;
            index -= m*s2i;


            index += index_partial[1];
            m = index / s2i;
            p2i += m;
            index -= m*s2i;


            index += index_partial[2];
            m = index / s2i;
            p2i += m;
            index -= m*s2i;


            index += index_partial[3];
            m = index / s2i;
            p2i += m;
            index -= m*s2i;


    return p2i-(p2i/d2i)*d2i;
}


